import React from 'react';
import { Redirect, withRouter } from 'react-router-dom';
import { drizzleConnect } from "drizzle-react";
import ContractData from "../ContractData";

class Resident extends React.Component {

	constructor(props) {
		super(props);
		const { history } = props;
	}

	render () {

		return(
			<div>
			<ContractForm contract="MadridCentral" name="Ingresar" method="deposit" sendArgs={{from: this.props.accounts[0], value: this.state.inputValue}} />
			<input type="number" onChange={evt => this.updateInputValue(evt)} />
			<ContractData contract="MadridCentral" method="residentExists"/>
			</div>
		);

		/*if (false) {
			return (
				<div>
					<Redirect to="/newResident" />
				</div>

			);
		} else {
			return (
				<div>
					<button onClick={() => history.push("/edit")}>
						Editar datos
					</button>
				</div>

			);
		}*/
	}
}

const mapStateToProps = state => {
  return {
    MadridCentral: state.contracts.MadridCentral,
    accounts: state.accounts
  };
};

export default drizzleConnect(Resident, mapStateToProps);
